"use strict";function initGist(){const e=document.getElementsByClassName("embed-gist");for(const t of e){if(t.classList.contains("embed-loaded"))continue;const e=t.dataset;t.innerHTML=`\n    <script src="https://gist.github.com/${e.gist}.js?"></script>\n    `,t.classList.add("embed-loaded")}}function initPlunker(){const e=document.getElementsByClassName("embed-plnkr");for(const t of e){if(t.classList.contains("embed-loaded"))continue;const e=t.dataset;t.innerHTML=`\n      <iframe height='${e.height||265}' scrolling='no' src='https://embed.plnkr.co/gist/${e.gist}?show=${e.show||"preview"}' frameborder='no'  allowfullscreen='true' style='width: 100%;'></iframe>\n    `,t.classList.add("embed-loaded")}}function initCodePen(){const e=document.getElementsByClassName("embed-codepen");for(const t of e){if(t.classList.contains("embed-loaded"))continue;const e=t.dataset;t.innerHTML=`\n      <iframe height='${e.height||265}' scrolling='no' title='${e.title}' src='https://codepen.io/${e.username}/embed/${e.id}/?height=${e.height||265}&theme-id=dark&default-tab=${e.tab||"result"}&embed-version=2' frameborder='no' allowtransparency='true' allowfullscreen='true' style='width: 100%;'></iframe>\n    `,t.classList.add("embed-loaded")}}initGist(),initPlunker(),initCodePen();